import {
  ContainerAnimation,
  ContainerFloor,
  WapperAnimation,
} from "./AnimationStyle";
import RootSvg from "./RootSvg";

const BoxAnimation = () => {
  return (
    <WapperAnimation>
      <ContainerAnimation>
        <ContainerFloor>
          <RootSvg />
        </ContainerFloor>
      </ContainerAnimation>
    </WapperAnimation>
  );
};
export default BoxAnimation;
